import React from 'react';
import { Switch, Route } from 'react-router-dom';

import ViewType from '../baseViewType/ViewType';
import ContEditWindow from '../EditWindow/ContEditWindow';
import Home from '../Home/Home';

const Main = () => (
  <main>
    <Switch>
        <Route exact path='/' component={Home}/>

        <Route exact path='/ViewType' component={ViewType}/>
    
        <Route exact path='/ContEditWindow' component={ContEditWindow}/>


    </Switch>
  </main>
)
export default Main
